    "2015-06-19T16:58:44.880050",nt"name": "orthoimagery-santa-clara-ca",nt"isopen":
    false,nt"url": null,nt"notes": "Digital orthographic imagery datasets contain
    georeferenced images of the Earth's surface, collected by a sensor in which object
    displacement has been removed for sensor distortions and orientation, and terrain
    relief. Digital orthoimages have the geometric characteristics of a map, and image
    qualities of a photograph. (Source: Circular A-16, p. 16) This data set contains
    imagery from the National Agriculture Imagery Program (NAIP). The NAIP acquires
    digital ortho imagery during the agricultural growing seasons in the continental
    U.S. A primary goal of the NAIP program is to enable availability of ortho imagery
    within one year of acquisition. The NAIP provides two main products: 1 meter ground
    sample distance (GSD) ortho imagery rectified to a horizontal accuracy within +/-
    5 meters of reference digital ortho quarter quads (DOQQ's) from the National Digital
    Ortho Program (NDOP) or from the National Agriculture Imagery Program (NAIP); 1
    meter GSD ortho imagery rectified within +/- 6 meters to true ground. The tiling
    format of NAIP imagery is based on a 3.75' x 3.75' quarter quadrangle with a 300
    meter buffer on all four sides. The NAIP imagery is formatted to the UTM coordinate
    system using the North American Datum of 1983 (NAD83). The NAIP imagery may contain
    as much as 10% cloud cover per tile. This file was generated by compressing NAIP
    imagery that cover the county extent. Two types of compression may be used for NAIP
    imagery: MrSID and JPEG 2000. Target value for the compression ratio is (15:1).",nt"license_title":
